schema:
{
 "description": "VirtualCluster is the Schema for the VirtualClusters API",
 "properties": {
  "spec": {
   "description": "VirtualClusterSpec defines the desired state of VirtualCluster.\n\n\nThis entity describes a virtual cluster. A virtual cluster is a Kubernetes\nnamespace that Amazon EMR is registered with. Amazon EMR uses virtual clusters\nto run jobs and host endpoints. Multiple virtual clusters can be backed by\nthe same physical cluster. However, each virtual cluster maps to one namespace\non an EKS cluster. Virtual clusters do not create any active resources that\ncontribute to your bill or that require lifecycle management outside the\nservice.",
   "properties": {
    "containerProvider": {
     "description": "The container provider of the virtual cluster.",
     "properties": {
      "id": {
       "type": "string"
      },
      "info": {
       "description": "The information about the container used for a job run or a managed endpoint.",
       "properties": {
        "eksInfo": {
         "description": "The information about the EKS cluster.",
         "properties": {
          "namespace": {
           "type": "string"
          }
         },
         "type": "object"
        }
       },
       "type": "object"
      },
      "type_": {
       "type": "string"
      }
     },
     "type": "object"
    },
    "name": {
     "description": "The specified name of the virtual cluster.",
     "type": "string"
    },
    "tags": {
     "additionalProperties": {
      "type": "string"
     },
     "description": "The tags assigned to the virtual cluster.",
     "type": "object"
    }
   },
   "required": [
    "containerProvider",
    "name"
   ],
   "type": "object"
  }
 },
 "title": "Virtual Cluster",
 "type": "object"
}
